import React, { useState } from "react";

const App = () => {

    let [num, setNum] = useState(0);

    const increment = () => {
    setNum(num + 1); 
    }    

    setInterval(increment, 1000);
    return(
        <>
            <h1>{num}</h1>
        </>
    );
}
export default App;
